/**
 * @author [Alex Neo]
 * @email [alex.neo0115@gmail.com]
 * @create date 2022-01-12 18:08:03
 * @modify date 2022-01-12 18:08:03
 * @desc [create reducer]
*/

import React from "react";
import PropTypes from "prop-types";
import { Input, Button, Form } from "antd";
import {
    UpCircleFilled,
    DownCircleFilled,
    EditOutlined
} from "@ant-design/icons";


const EmployeeList = ({type, voluntary, name, designation}) => {

    return( 
        <div style={{margin: '5px'}}>
            <Form layout="inline">
                <Form.Item name="content" >
                    <div style={{color:'#000', background: type === 'eligible'? (voluntary ? 'red': 'black')
                          : 'grey', width: '60px', height: '60px'}}></div>
                </Form.Item>
                <Form.Item>
                    <span style={{color:'#000'}}>{name}</span>
                </Form.Item>
                <Form.Item>
                    <span style={{color:'#000'}}>{designation}</span>
                </Form.Item>
            </Form>
        </div>
    );
};

EmployeeList.propTypes = {
	name: PropTypes.string,
    voluntary: PropTypes.bool,
    designation: PropTypes.string,
    type: PropTypes.string
};

export default EmployeeList;
